  <div class="row justify-content-center login-container mt-5">
    <div class="col-sm-11 col-md-8 col-lg-6">
      <div class="card mt-5 p-5">
        <div class="card-body p-3">
          <div class="d-flex justify-content-start mt-5 px-5">
            <h2 class="fw-bold fs-1" style="color:#111A66;">Log In</h2>
          </div>

          <!-- Start: Flash Messages -->
          <div id="flash-messages" class="row text-center px-5">
            <div class="col">
              {% with messages = get_flashed_messages() %}
              {% if messages %}
              <div id="flash-messages" class="text-center">
                {% for message in messages %}
                <div class="alert alert-warning" role="alert">{{ message }}</div>
                {% endfor %}
              </div>
              {% endif %}
              {% endwith %}
            </div>
          </div>
          <!-- End: Flash Messages -->
          
          <div class="row mt-4">
            <div>
              <form class="px-5" action="/login" method="post">
                <div class="row mb-5">
                  <div class="col">
                    <!-- Start: Email -->
                    <div class="mb-4">
                      <label class="form-label fw-bold fs-5" style="color:#636262">Email<span class="text-danger fw-bold">*</span></label>
                      <input class="form-control" type="email" required name="Email">
                    </div>
                    <!-- End: Email -->

                    <!-- Start: Password -->
                    <!-- <div>
                      <label class="form-label">Password<span class="text-danger fw-bold">*</span></label>
                      <input class="form-control mb-3" type="password" required name="Password">
                    </div> -->
                    <!-- End: Password -->


                    <div class="mb-3">
                      <label for="password-input" class="form-label fw-bold fs-5" style="color:#636262">Password<span
                          class="text-danger fw-bold">*</span></label>
                      <div class="input-group">
                        <input type="password" class="form-control" required name="Password" id="password-input">
                        <button class="btn btn-outline-secondary" type="button" id="toggle-password">
                          <i class="fas fa-eye"></i>
                        </button>
                      </div>
                    </div>

                    <div class="w-100 d-flex justify-content-end">
                      <a class="fw-bold fs-6" style="color:#636262" href="/forgot_password">Forgot
                        Password?</a>
                    </div>
                  </div>
                </div>

                <!-- Start: Form Submit -->

                <div class="row mb-6">
                  <div class="col d-flex flex-column align-items-center">
                    <button class="btn btn-lg btn-primary w-100 mb-3 fw-bold fs-4" type="submit" value="Log In"
                      name="Log In">Login</button>
                    <div class="d-flex w-100 text-decoration-underline">
                      <span style="color: #111A66;">Don't have an account?&nbsp;</span> 
                      <a style="color: #111A66;" href="/create">Sign Up</a>
                    </div>
                  </div>
                </div>
              </form>
              <!-- End: Login Form -->
            </div>
          </div>
          
        </div>
      </div>
    </div>
    <!-- end of login form -->
